AUX_SCHEMA = StructType(
    [
        StructField(ColNames.geometry, StringType(), nullable=False),
        StructField(ColNames.grid_id, IntegerType(), nullable=False),
        StructField(ColNames.elevation, FloatType(), nullable=True),
        StructField(ColNames.prior_probability, FloatType(), nullable=True),
        StructField(ColNames.ple_coefficient, FloatType(), nullable=True),
        # partition columns
        StructField(ColNames.quadkey, StringType(), nullable=True),
    ]
)


def set_input_data(spark: SparkSession, config: ConfigParser):
    """
    DESCRIPTION:
        Function to prepare the test data for the tests.
    """
    # Prepare test data

    transportation_do = BronzeTransportationDataObject(
        spark,
        config.get(CONFIG_BRONZE_PATHS_KEY, "transportation_data_bronze"),
    )

    transportation_sdf = spark.read.format("geoparquet").load(f"{STATIC_TEST_DATA_PATH}/spatial_data/transportation")

    transportation_do.df = transportation_sdf
    transportation_do.write()

    landuse_do = BronzeLanduseDataObject(spark, config.get(CONFIG_BRONZE_PATHS_KEY, "landuse_data_bronze"))

    landuse_sdf = spark.read.format("geoparquet").load(f"{STATIC_TEST_DATA_PATH}/spatial_data/landuse")

    landuse_do.df = landuse_sdf
    landuse_do.write()

    grid_do = SilverGridDataObject(spark, config.get(CONFIG_SILVER_PATHS_KEY, "grid_data_silver"))

    grid_sdf = spark.createDataFrame(generate_input_grid_data()).withColumn("geometry", STC.ST_GeomFromEWKT("geometry"))
    grid_sdf = apply_schema_casting(grid_sdf, SilverGridDataObject.SCHEMA)

    grid_do.df = grid_sdf
    grid_do.write()


